pragma solidity ^0.8.7;

contract Item {
    uint public priceInWei;
    uint public index;
    uint public pricePaid;

    ItemManager parentContract;

    constructor(ItemManager _parentContract, uint _priceInWei, uint _index) public {
        priceInWei= _priceInWei;
        index=_index;
        parentContract =_parentContract;
    }

    receive ()external payable {
        require(pricePaid==0, "Item is already paid");
        require(priceInWei==msg.value, "Only full payments allowed");
        pricePaid += msg.value;
     (bool success, ) = address(parentContract).call{value:msg.value}(abi.encodeWithSignature("triggerPayment(uint256)", index));
     require (success, "The transaction was not successful, cancelling");
      }

      fallback() external{

      }

}

contract ItemManager {

    enum SupplyChainState {Created, Paid, Delivered}

    struct S_Item {
        string _identifier;
        uint _itemPrice;
        ItemManager.SupplyChainState _state;

    }

    mapping(uint => S_Item) public items;
    uint itemIndex;

    event SupplyChainStep (uint _idemIndex, uint _step );

    function createItem (string memory _identifier, uint _itemPrice) public {
        items[itemIndex]._identifier = _identifier;
        items[itemIndex]._itemPrice = _itemPrice;
        items[itemIndex]._state = SupplyChainState.Created;
        emit SupplyChainStep(itemIndex, uint(items[itemIndex]._state));
        itemIndex++;
         }

    function triggerPayment (uint _itemIndex) public payable {
        require (items[_itemIndex]._itemPrice == msg.value, "Only full payments accepted");
        require (items[_itemIndex]._state == SupplyChainState.Created, "Item is further in the chain");
        items[_itemIndex]._state = SupplyChainState.Paid;

         emit SupplyChainStep (_itemIndex, uint(items[_itemIndex]._state));
          }

    function triggerDelivery (uint _itemIndex) public {
        require (items[itemIndex]._state == SupplyChainState.Paid, "Item is further in the chain");
        items[itemIndex]._state = SupplyChainState.Delivered;

         emit SupplyChainStep (_itemIndex, uint(items[_itemIndex]._state));
         }
}

